// src/App.js
import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './pages/Navbar';
import Home from './pages/Home';
import MyFixture from './pages/MyFixture';
import OtherFixture from './pages/OtherFixture';
import TeamSheet from './pages/TeamSheet';

const App = () => {
  const [formData, setFormData] = useState({});
  const [events, setEvents] = useState([]);

  return (
    <Router>
      <div>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home setFormData={setFormData} />} />
          <Route path="/my-fixture" element={<MyFixture events={events} />} />
          <Route path="/other-fixture" element={<OtherFixture />} />
          <Route
            path="/team-sheet"
            element={<TeamSheet formData={formData} setEvents={setEvents} />}
          />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
